import React, { } from 'react';
import './App.css';
import { Table, Container, Button} from 'react-bootstrap'

import ModalNew from './Modal'

const Visualizacao = props => {
  this.state ={
    value:false
  }
  return (
    <div>
      <Container>
        <Table striped bordered hover>
          <thead>
            <tr>
              {props.colunas.map((item, key) => <th key={key}> {item} </th>)}
            </tr>
          </thead>
          <tbody>
            {props.users.filter(
              (valores, index) => index >= 0 && index < 10)
              .map((item, indice) =>
                <tr key={indice}>
                  <td>{item.id}</td>
                  <td>{item.nome}</td>
                  <td>{item.cnpj}</td>
                  <td>{item.insc}</td>
                  <td>{item.latitude}</td>
                  <td>{item.longitude}</td>
                  <td><Button variant="primary" onClick={() => console.log(item)}>Primary</Button>{' '}<Button variant="danger" onClick={() => props.removeUser(item)}>Remove</Button>
                  </td>
                </tr>
              )}
          </tbody>
        </Table>
        <ModalNew value = {this.state.value}/>
      </Container>
    </div >
  )
}
export default (Visualizacao);
